import React from "react";
import Card from "../UI/Card/Card";
import classes from "./Music.module.css";

const Music = (props) => {
  let totalClasses = ` ${classes.music} ${props.className}`;
  return (
    <Card className={totalClasses} genre={props.genre}>
      <h2>{props.title}</h2>
      <h3>{props.album}</h3>
      <p>{props.author}</p>
    </Card>
  );
};

export default Music;
